import React, { useState, useEffect, Fragment } from "react";
import { Layout } from "antd";
import {
  HeaderTitle,
  CustomTable,
  CustomModal,
  openNotification,
  CustomDrawer,
  CustomDrawerButton
} from "./";
const { Content } = Layout;
const PersonalContent = () => {
  const [drawerVisible, setDrawerVisible] = useState();
  const [personal] = useState(true);
  // custom Drawer
  const showDrawer = () => {
    setDrawerVisible(true);
  };
  const onhandleAdd = async items => {
    // await addDishes(items);
  };

  const onClose = () => {
    setDrawerVisible(false);
  };

  return (
    <Fragment>
      <Content style={{ margin: "2em 16px" }}>
        <div style={{ background: "#fff", padding: 24, minHeight: 280 }}>
          <HeaderTitle title="Personal Menu" />
          <CustomDrawerButton title="Add" showDrawer={showDrawer} />
          <CustomDrawer
            personal={personal}
            title="Add Personal"
            visible={drawerVisible}
            onClose={onClose}
            onhandleAdd={onhandleAdd}
            firsItem={"First Name"}
            secondItem={"LastName "}
            thirdItem={"Gender"}
            fourthItem={"Address"}
            fiveItem={"Password"}
            sixItem={"Phonenumber"}
            sevenItem={"Work Position"}
            eightItem={"Age"}
            nineItem={"Salary"}
            tenItem={"EMail"}
            elevenItem={"Date"}
          />
        </div>
      </Content>
    </Fragment>
  );
};

export { PersonalContent };
